import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css';

const workItems = [
  { id: 'downtown-ring', title: 'Downtown Ring', thumbnail: '/public/2025.04.03-Downtown-Ring-Maker-vid-01.mp4' },
  { id: 'crocodiles', title: 'Crocodiles', thumbnail: '/public/crocos-01.jpg' },
  { id: 'central23', title: 'Central 23', thumbnail: '/public/DinosaurPrint.jpg' },
];

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="grid">
      {workItems.map((item) => (
        <div key={item.id} className="grid-item" onClick={() => navigate(`/work/${item.id}`)}>
          <img src={item.thumbnail} alt={item.title} />
          <div className="title-overlay">{item.title}</div>
        </div>
      ))}
    </div>
  );
};

export default Home;
